import Header from "../../Components/Header/Header";
import Footer from "../../Components/Footer/Footer";
import styles from "./Home.module.css";

/*Componentes*/
import Boton from "../../Components/Boton/Boton";

export default function Home() {
    return (
        <>
          <Header/>
          <Main/>
          <Footer/>
        </>
    );
}

function Main() {
  return (
    <main className={styles.mainContainer}>
      <form >
        <label for="username-register-form">Nombre de usuario</label>
        <input id="username-register-form" type="text"></input>

        <label for="password-register-form">Contraseña</label>
        <input id="password-register-form" type="password"></input>

        <label for="passwordAgain-register-form" type="password">Repita su constraseña</label>
        <input id="passwordAgain-register-form" type="password"></input>

        <div>
          <Boton style="aceptar" type="submit" text="Aceptar" onClickFunction={HolaMundo}/>
          <Boton style="limpiar" type="reset" text="Limpiar"/>
        </div>
      </form>
    </main> 
  );
}

function HolaMundo(event) {
  console.log("Hola mundo :D");
}
